import React from 'react';
import '../App.css'; 
import './MyDataGrid.css'

function MyDataGrid(props) {

    return(
        <div className='MyDataGrid'>
            <table>
                <tr>
                    <th> .   </th>
                    <th>Task</th>
                    <th>Priority</th>
                    <th>Due Date</th>
                    <th>Edit</th>
                    <th>Delete</th>
                </tr>
                    {props.rows.map((val, key) => {
                        return (
                            <tr key={key}>
                                <td>    </td>
                                <td>{val.text}</td>
                                <td>{val.priority}</td>
                                <td>{val.due_date}</td>
                                <td></td>
                                <td></td>
                            </tr>
                        )
                    })}
            </table>
        </div>
    );
}

export default MyDataGrid;
